import axios from "axios"

const BASE_URL = "http://localhost:8080/users"

function getUsuarios(){
    return axios.get("http://localhost:8080/users");
}

function eliminarPorId(id){

return axios.delete("http://localhost:8080/users/" + id);

}


export {getUsuarios};
